import React, { useState, useEffect } from 'react';
import ClientService from './ClientService';

const ClientLister = () => {
    const [clientList, setClientList] = useState([]);
    const [filterName, setFilterName] = useState('');
    const [filterAddress, setFilterAddress] = useState('');
    const [filterEmail, setFilterEmail] = useState('');

    useEffect(() => {
        ClientService.getAllClients()
            .then(response => setClientList(response.data))
            .catch(error => console.error(error));
    }, []);

    return (
        <div className="list-page">
            <div className="header-row">
                <h2>Client List</h2>
                <button className="modify-button">Add New Client</button>
            </div>

            {/* Filter Inputs */}
            <div className="filter-container">
                <div className="filter-box">
                    <label className="filter-label">Name</label>
                    <input
                        type="text"
                        value={filterName}
                        onChange={(e) => setFilterName(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Name"
                    />
                </div>
                <div className="filter-box">
                    <label className="filter-label">Address</label>
                    <input
                        type="text"
                        value={filterAddress}
                        onChange={(e) => setFilterAddress(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Address"
                    />
                </div>
                <div className="filter-box">
                    <label className="filter-label">Email</label>
                    <input
                        type="text"
                        value={filterEmail}
                        onChange={(e) => setFilterEmail(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Email"
                    />
                </div>
            </div>

            {/* Client List Display */}
            <div className="table">
                {clientList.filter(client =>
                    client.name.toLowerCase().includes(filterName.toLowerCase()) &&
                    client.address.toLowerCase().includes(filterAddress.toLowerCase()) &&
                    client.email.toLowerCase().includes(filterEmail.toLowerCase())
                ).map(client => (
                    <div className="table-row" key={client.clientId}>
                        <div className="form-field">{client.name}</div>
                        <div className="form-field">{client.address}</div>
                        <div className="form-field">{client.email}</div>
                        <div className="form-field">{client.phoneNumber}</div>
                        <div className="action-buttons">
                            <button className="modify-button">Modify</button>
                            <button className="delete-button">Delete</button>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default ClientLister;
